import React from 'react'
import { AppContext } from '../App';
import { useContext } from 'react';
import { useNavigate } from "react-router-dom";

function Kindergardens() {
    const {city, kData} = useContext(AppContext)
    const navigate = useNavigate();
  return (
    <div> Here is available Kindergardens list for: {city}
    <div className='available'>
    Available:
    {/* {users.map((i) => (
            <div className='content'>
              <div className='userName'> {i.name}</div>
            </div>
          ))} */}

    {kData.Kindergardens.map((i) => (
            <div className='content'>
              <div className='id'> {i.id}</div>
              <div className='list'> {i.list}</div>
              <div className='months'> {i.months}</div>
            </div>
          ))}
    </div>
    
    </div>
  )
}

export default Kindergardens
